webpackJsonp([0x8d58513302c4],{730:function(e,a){e.exports={data:{markdownRemark:{html:'<figure id="media-1028" class="align-center">\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; z-index: 0 !important;; max-width: 800px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 84.39999999999999%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;" alt="Formidable logo on London night sky" title="" src="/static/london_launch_web-81faf01f19489b1a6050437bb215dc9d-fc76f.png" srcset="/static/london_launch_web-81faf01f19489b1a6050437bb215dc9d-290b0.png 200w,\n/static/london_launch_web-81faf01f19489b1a6050437bb215dc9d-14201.png 400w,\n/static/london_launch_web-81faf01f19489b1a6050437bb215dc9d-fc76f.png 800w,\n/static/london_launch_web-81faf01f19489b1a6050437bb215dc9d-0fcde.png 1200w,\n/static/london_launch_web-81faf01f19489b1a6050437bb215dc9d-946fa.png 1600w,\n/static/london_launch_web-81faf01f19489b1a6050437bb215dc9d-17a4c.png 2000w" sizes="(max-width: 800px) 100vw, 800px">\n    </span>\n  </span>\n  </figure>\n<p>Hi there. I&#x2019;m <a href="https://twitter.com/jevakallio">Jani Ev&#xE4;kallio</a>, Formidable&#x2019;s new VP of Mobile Engineering. Along with my arrival, today I have the great pleasure of announcing the opening of Formidable in London.</p>\n<p>In my previous life I was the lead engineer at Futurice London, an early React and React Native advocate, and the creator of the <a href="https://github.com/futurice/pepperoni-app-kit">Pepperoni App Kit</a>. At Formidable, I&#x2019;ll lead our London operations from our new offices right by the Silicon Roundabout, in the heart of Europe&#x2019;s most vibrant tech hub.</p>\n<p>I have followed Formidable&#x2019;s impressive contributions to the JavaScript OSS ecosystem for years. With Formidable in the UK, we&#x2019;ll have an increase in OSS contributions, more great people, and landing pads on both sides of the pond. I&#x2019;m looking forward to being involved in the company&#x2019;s growth outside of the US, working with the most ambitious customers on both continents.</p>\n<h2>Launch Event October 20th</h2>\n<p>To celebrate our launch, we&#x2019;re bringing a group of engineers, including <a href="https://twitter.com/alexlande">Alex Lande</a>, author of <a href="https://formidable.com/open-source/radium/">Radium</a>, and <a href="https://twitter.com/ken_wheeler">Ken Wheeler</a>, author of <a href="https://formidable.com/blog/2016/08/15/introducing-webpack-dashboard/">Webpack Dashboard</a>, to say hello and talk ReactJS and React Native. Join us at our <a href="https://www.meetup.com/formidable-london/events/234420644/">launch event</a> for talks, food, and beverage the evening of October 20th.</p>\n<h2>Focus on Native</h2>\n<p>Like Seattle, the London team will be building JavaScript applications for companies of all sizes, though our UK location will have a particular focus on native app development. We&#x2019;re excited to further expand our offerings into the mobile realm and this team will pioneer that effort.</p>\n<h2>We&#x2019;re Hiring</h2>\n<p>Looking to be part of something incredible? Join our growing team in London as a <a href="https://jobs.lever.co/formidable/a5b07538-e53a-4968-85f1-8698455ac0d8">Mobile Engineer</a> or a <a href="https://jobs.lever.co/formidable/e58d74d7-3865-4777-bb8a-5d0a2429bdb8">Senior Software Engineer</a>.</p>',fields:{slug:"/blog/2016/09/29/london-formidable-has-landed/"},frontmatter:{id:28,authorId:1,categoryIds:[4,6],date:"2016-09-29",pageDescription:"Formidable's new London office, specializing in React Native",pageKeywords:"",pageTitle:"Formidable's new London office, specializing in React Native",path:"/2016/09/29/london-formidable-has-landed/",title:"London: Formidable Has Landed."}}},pathContext:{slug:"/blog/2016/09/29/london-formidable-has-landed/",prev:{fields:{slug:"/blog/2016/09/22/announcing-the-release-of-spectacle-editor/"},frontmatter:{authorId:3,categoryIds:[6],date:"2016-09-22",id:27,title:"Announcing the Release of Spectacle Editor"}}}}}});